import React from 'react';
import './App.css';
import axios from 'axios';
import Router from './Router';
import NavBar from './components/NavBar';

class App extends React.Component {

  render() {
    const {users} = this.state;
    return (
      <>
        <NavBar />
        <Router users={users} /> 
      </>
    )
  }
}

export default App
